import BurgerConstructor from "../BurgerConstructor/BurgerConstructor";
import MenuConstructor from "../MenuConstructor/MenuConstructor";
import ProfileIconConstructor from "../ProfileIconConstructor/ProfileIconConstructor";
import { Logo } from "@ya.praktikum/react-developer-burger-ui-components";

import styles from "./styles.module.css";
import ButtonConstructor from "../ButtonConstructort/ButtonConstructort";

function AppHeader() {
  return (
    <header className={styles.box}>
      <ButtonConstructor>
        <span className={`${styles.wrapper}  ml-2`}>
          <BurgerIcon type="primary" />
          <span className="text text_type_main-default ml-2 mr-5">
            Конструктор
          </span>
        </span>
      </ButtonConstructor>

      <ButtonConstructor>
        <MenuConstructor />
      </ButtonConstructor>

      <div className={styles.logo}>
        <Logo />
      </div>
      <ButtonConstructor>
        <ProfileIconConstructor />
      </ButtonConstructor>
    </header>
  );
}

export default AppHeader;
